4\u0451\u043d\u043d\u044b\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1763_%D0%B3%D0%BE%D0%B4\" title=\"1763 \u0433\u043e\u0434\">1763<\/a>&#160;\u2014 \u041f\u043e\u0434 \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b II<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%B8%D0%BD%D0%BE%D0%B4\" class=\"mw-redirect\" title=\"\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u044b\u0439 \u0441\u0438\u043d\u043e\u0434\">\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u044b\u0439 \u0421\u0438\u043d\u043e\u0434<\/a> \u043b\u0438\u0448\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%81%D0%B5%D0%BD%D0%B8%D0%B9_(%D0%9C%D0%B0%D1%86%D0%B5%D0%B5%D0%B2%D0%B8%D1%87)\" title=\"\u0410\u0440\u0441\u0435\u043d\u0438\u0439 (\u041c\u0430\u0446\u0435\u0435\u0432\u0438\u0447)\">\u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0430 \u0410\u0440\u0441\u0435\u043d\u0438\u044f<\/a> \u0435\u0433\u043e \u0441\u0430\u043d\u0430 \u0438 \u0441\u043e\u0441\u043b\u0430\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C\" title=\"\u041c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c\">\u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1775_%D0%B3%D0%BE%D0%B4\" title=\"1775 \u0433\u043e\u0434\">1775<\/a>&#160;\u2014 \u0421\u043a\u0430\u0447\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B2%D0%B8%D1%80,_%D0%9F%D0%BE%D0%BB\" title=\"\u0420\u0435\u0432\u0438\u0440, \u041f\u043e\u043b\">\u0420\u0435\u0432\u0438\u0440\u0430<\/a>, \u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u0435 \u0441\u043e\u0431\u044b\u0442\u0438\u0435, \u043e\u0437\u043d\u0430\u043c\u0435\u043d\u043e\u0432\u0430\u0432\u0448\u0435\u0435 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0421\u0428\u0410\">\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B1%D0%BE%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0422\u043e\u0431\u043e\u043b\u044c\u0441\u043a\">\u0422\u043e\u0431\u043e\u043b\u044c\u0441\u043a\u0435<\/a> \u0431\u044b\u043b\u0430 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u0442\u0438\u043f\u043e\u0433\u0440\u0430\u0444\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A%D0%BE%D1%80%D0%BD%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2%D0%B8%D1%87&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a\u043e\u0440\u043d\u0438\u043b\u044c\u0435\u0432, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u0430\u0441\u0438\u043b\u0438\u044f \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447\u0430 \u041a\u043e\u0440\u043d\u0438\u043b\u044c\u0435\u0432\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439, \u043a\u0430\u043a \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u0438\u0437 \u0443\u043a\u0430\u0437\u0430 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044f \u0442\u043e\u0431\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0410.&#160;\u0412.&#160;\u0410\u043b\u044f\u0431\u044c\u0435\u0432\u0430, \u0436\u0435\u043b\u0430\u043b \u00ab\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u044c \u043d\u0430 \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u043b\u0443\u0447\u0430\u0439 \u043f\u0435\u0447\u0430\u0442\u0430\u043d\u0438\u0435 \u043a\u043d\u0438\u0433 \u043d\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u043c \u0434\u0438\u0430\u043b\u0435\u043a\u0442\u0435 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u043b\u0438\u0442\u0435\u0440\u0430\u043c\u0438, \u0438 \u0432\u043f\u0440\u0435\u0434\u044c \u0441\u0442\u0430\u0440\u0430\u0442\u044c\u0441\u044f \u0431\u0443\u0434\u0435\u0442 \u0438 \u043d\u0430 \u0440\u0430\u0437\u043d\u044b\u0445 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445\u00bb. \u042d\u0442\u043e \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0442\u0438\u043f\u043e\u0433\u0440\u0430\u0444\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%8C\" title=\"\u0421\u0438\u0431\u0438\u0440\u044c\">\u0421\u0438\u0431\u0438\u0440\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1791_%D0%B3%D0%BE%D0%B4\" title=\"1791 \u0433\u043e\u0434\">1791<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82\" class=\"mw-redirect\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\">\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442<\/a> \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0430\u0431\u0441\u0442\u0432\u043e\">\u0440\u0430\u0431\u0441\u0442\u0432\u043e<\/a> \u0432 \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u044f\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1793_%D0%B3%D0%BE%D0%B4\" title=\"1793 \u0433\u043e\u0434\">1793<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u044f \u043f\u0435\u0440\u0432\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BD%D1%8F%D1%8F_%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u0412\u0435\u0440\u0445\u043d\u044f\u044f \u041a\u0430\u043d\u0430\u0434\u0430\">\u0412\u0435\u0440\u0445\u043d\u0435\u0439 \u041a\u0430\u043d\u0430\u0434\u0435<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0435\u0446 \u0420\u043e\u044f\u043b \u0425\u0430\u0443\u0441 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;Royal E. House) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B3%D1%80%D0%B0%D1%84\" title=\"\u0422\u0435\u043b\u0435\u0433\u0440\u0430\u0444\">\u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043d\u044b\u04