ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BD%D0%BD%D0%B0\" class=\"mw-disambig\" title=\"\u0422\u0430\u043d\u043d\u0430\">\u0422\u0430\u043d\u043d\u0430<\/a>, 36 \u043a\u043c).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">I \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a> \u043f\u0440\u0438\u043d\u044f\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BF%D0%BE%D0%B3%D1%80%D0%B5%D1%88%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%BF%D0%B0%D0%BF%D1%8B\" class=\"mw-redirect\" title=\"\u041d\u0435\u043f\u043e\u0433\u0440\u0435\u0448\u0438\u043c\u043e\u0441\u0442\u044c \u043f\u0430\u043f\u044b\">\u0434\u043e\u0433\u043c\u0430\u0442 \u043e \u043d\u0435\u043f\u043e\u0433\u0440\u0435\u0448\u0438\u043c\u043e\u0441\u0442\u0438 \u041f\u0430\u043f\u044b \u0420\u0438\u043c\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1881_%D0%B3%D0%BE%D0%B4\" title=\"1881 \u0433\u043e\u0434\">1881<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B5%D1%81%D1%82%D0%B5%D1%81%D1%82%D0%B2%D0%BE%D0%B7%D0%BD%D0%B0%D0%BD%D0%B8%D1%8F_(%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD)\" title=\"\u041c\u0443\u0437\u0435\u0439 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u043e\u0437\u043d\u0430\u043d\u0438\u044f (\u041b\u043e\u043d\u0434\u043e\u043d)\">\u0415\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u0435\u0439<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%9A%D0%B5%D0%BD%D1%81%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD\" title=\"\u042e\u0436\u043d\u044b\u0439 \u041a\u0435\u043d\u0441\u0438\u043d\u0433\u0442\u043e\u043d\">\u042e\u0436\u043d\u043e\u043c \u041a\u0435\u043d\u0441\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u043e\u0435 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u0435 (\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a>) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BA%D1%82%D0%B8%D0%BB%D0%BE%D1%81%D0%BA%D0%BE%D0%BF%D0%B8%D1%8F\" title=\"\u0414\u0430\u043a\u0442\u0438\u043b\u043e\u0441\u043a\u043e\u043f\u0438\u044f\">\u0434\u0430\u043a\u0442\u0438\u043b\u043e\u0441\u043a\u043e\u043f\u0438\u0438<\/a> \u0434\u043b\u044f \u043e\u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%A