tle=\"\u0420\u0435\u0439\u0434 \u0414\u0443\u043b\u0438\u0442\u0442\u043b\u0430\">\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043d\u0430\u043b\u0451\u0442<\/a> \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0430\u0432\u0438\u0430\u0446\u0438\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE\" title=\"\u0422\u043e\u043a\u0438\u043e\">\u0422\u043e\u043a\u0438\u043e<\/a> \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%BB%D0%B8%D1%82%D1%82%D0%BB,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81\" title=\"\u0414\u0443\u043b\u0438\u0442\u0442\u043b, \u0414\u0436\u0435\u0439\u043c\u0441\">\u0414\u0436. \u0414\u0443\u043b\u0438\u0442\u0442\u043b\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%9C%D0%B5%D1%81%D1%82%D1%8C%C2%BB\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u041c\u0435\u0441\u0442\u044c\u00bb\">\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u041c\u0435\u0441\u0442\u044c\u00bb<\/a>: \u043b\u0438\u043a\u0432\u0438\u0434\u0430\u0446\u0438\u044f \u0433\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u044f\u043f\u043e\u043d\u0441\u043a\u0438\u043c \u0444\u043b\u043e\u0442\u043e\u043c \u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BC%D0%B0%D0%BC%D0%BE%D1%82%D0%BE,_%D0%98%D1%81%D0%BE%D1%80%D0%BE%D0%BA%D1%83\" title=\"\u042f\u043c\u0430\u043c\u043e\u0442\u043e, \u0418\u0441\u043e\u0440\u043e\u043a\u0443\">\u042f\u043c\u0430\u043c\u043e\u0442\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 \u041e\u